import React, { useState } from "react";

const NewApplication = () => {
  const [tckn, setTckn] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("");
  const [name, setName] = useState("");
  const [surname, setSurname] = useState("");
  const [email, setEmail] = useState("");
  const [address, setAddress] = useState("");
  const [monthlySalary, setMonthlySalary] = useState("");
  const [loanAmount, setLoanAmount] = useState("");
  const [campaingName, setCampaingName] = useState("");
  const [termLoan, setTermLoan] = useState("");
  const [interestRate, setInterestRate] = useState("");


  return (
    <div>
      <form>
        <input
          type="text"
          value={setTckn}
          onChange={(e) => setTckn(e.target.value)}
          placeholder="TCKN"
          required
        />
        <input
          type="text"
          value={setPhoneNumber}
          onChange={(e) => setPhoneNumber(e.target.value)}
          placeholder="Telefon Numarası"
          required
        />
        <input
          type="text"
          value={setName}
          onChange={(e) => setName(e.target.value)}
          placeholder="Ad"
          required
        />
        <input
          type="text"
          value={setSurname}
          onChange={(e) => setSurname(e.target.value)}
          placeholder="Soyad"
          required
        />
        <input
          type="text"
          value={setEmail}
          onChange={(e) => setEmail(e.target.value)}
          placeholder="Email"
          required
        />
        <input
          type="text"
          value={setAddress}
          onChange={(e) => setAddress(e.target.value)}
          placeholder="Adres"
          required
        />
        <input
          type="text"
          value={setMonthlySalary}
          onChange={(e) => setMonthlySalary(e.target.value)}
          placeholder="Aylık Gelir"
          required
        />
        <input
          type="text"
          value={setLoanAmount}
          onChange={(e) => setLoanAmount(e.target.value)}
          placeholder="Kredi Tutarı"
          required
        />
                <input
          type="text"
          value={setCampaingName}
          onChange={(e) => setCampaingName(e.target.value)}
          placeholder="Kampanya Seçimi"
          required
        />
                <input
          type="text"
          value={setTermLoan}
          onChange={(e) => setTermLoan(e.target.value)}
          placeholder="Vade"
          required
        />
                <input
          type="text"
          value={setInterestRate}
          onChange={(e) => setInterestRate(e.target.value)}
          placeholder="Faiz Oranı"
          required
        />
      </form>
    </div>
  );
};
export default NewApplication();
